import Dashboard from "../layouts/Dashboard/Dashboard.jsx";
import Login from '../layouts/Login/Login';

var indexRoutes = [
    { path: "/", name: "Home", component: Login },
    { path: "/login", name: "Login", component: Login }
];

export default indexRoutes;
